import '../../App.css';

interface IProvidersProps {
  clinic: any;
  providers: any;
}

function Clinic(props: IProvidersProps) {
  return (
    <div style={{
      display: 'flex',
      flexDirection: 'column',
      width: 800,
      border: '1px solid #E6E6E6',
      backgroundColor: 'white',
      alignItems: 'flex-start',
      padding: 20
    }}>
      <p style={{ fontWeight: 'bold', color: 'black', margin: '0 0', lineHeight: 0 }}>{props.clinic?.name}</p>
      <p style={{ fontWeight: 'normal', color: 'black', textAlign: 'left' }}>
        {props.clinic?.address}
        <br/>
        {props.clinic?.city}, {props.clinic?.state} {props.clinic?.zipcode}
      </p>
      <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'center'}}>
        <div style={{ marginRight: '10px' }}>
          <img src={require("../../assets/provider.png")} alt="provider" width={80} height={80} style={{borderRadius: 40}} />
        </div>
        { props.providers?.length &&
          props.providers.map((provider: any, index: number) => {
            const data = provider?.provider;
            const date = new Date(provider?.startTime);
            const timeString = date.toLocaleTimeString([], { hour: 'numeric', minute: '2-digit', hour12: true })

            return ( data &&
              <div style={{marginLeft: 10, marginRight: 10}} key={index}>
                <div style={{textAlign: 'left'}}>
                  <p style={{ fontWeight: 'bold', color: '#35E7F6', margin: '0 0'}}>{data.name}</p>
                  <p style={{ color: 'black', marginTop: 10, marginBottom: 10, fontSize: 14}}>{data.phoneNumber}</p>
                  <button style={{ backgroundColor: '#395D75', color: 'white', width: 80, height: 30, fontWeight: 'bold' }}>{timeString}</button>
                </div>
              </div>
            )
          })
        }
      </div>
    </div>
  );
}

export default Clinic;
